import React from "react";
import "../containers/Home.css";
import NavButton from "../components/NavButton.js";

export default function Step2() {
  return (
    <div className="Step1">
      <div className="lander">
        <h1>Stap 2</h1>
        <LinkContainer to="/step1">
          <Button>Back</Button>
        </LinkContainer>
      </div>
    </div>
  );
}
